import React from 'react';
import styled from '@emotion/styled';

const SnowDetailsList = styled("div")`
display: flex;
height: 100%;
flex-direction: row;
flex-wrap: wrap;
justify-content: space-around;
align-content: center;

.title {
  width: 100%;
  text-align: center;
  margin-bottom: 10px;
}
.flex-item {
  width: 25%;
  text-align: center;
}
`

export const SnowDetails = ({ lowElevationName, lowElevation, highElevationName, highElevation, newSnowLastDayCoq, newSnowLastTwoDayCoq, newSnowLastWeekCoq, snowDepthCoq, newSnowLastDayLit, newSnowLastTwoDayLit, newSnowLastWeekLit, snowDepthLit }) => {
  return (
    <SnowDetailsList>
      <h3 className="title">Snow Conditions</h3>
      <div className="title">{highElevationName} {highElevation}</div>
      <div className="flex-item">24hr</ div>
      <div className="flex-item">48hr</ div>
      <div className="flex-item">7 Days</ div>
      <div className="flex-item">Base</ div>
      <div className="flex-item">{newSnowLastDayCoq}cm</ div>
      <div className="flex-item">{newSnowLastTwoDayCoq}cm</ div>
      <div className="flex-item">{newSnowLastWeekCoq}cm</ div>
      <div className="flex-item">{snowDepthCoq}cm</ div>
      <div className="title">{lowElevationName} {lowElevation}</div>
      <div className="flex-item">24hr</ div>
      <div className="flex-item">48hr</ div>
      <div className="flex-item">7 Days</ div>
      <div className="flex-item">Base</ div>
      <div className="flex-item">{newSnowLastDayLit}cm</ div>
      <div className="flex-item">{newSnowLastTwoDayLit}cm</ div>
      <div className="flex-item">{newSnowLastWeekLit}cm</ div>
      <div className="flex-item">{snowDepthLit}cm</ div>
    </SnowDetailsList>
  )
}
